function LoginForm() {
    return (
        <form>
            <h2>Login Page</h2>
            <label>Username :</label><br />
            <input type="text" id="username" /><br />
            <label>Password :</label><br />
            <input type="text" id="password" /><br />
            <input type="submit" value="submit" />
        </form>
    )
}

export default LoginForm
